import { Nav } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
const Home = () => {
  return (
    <div>
      <Nav
        className="justify-content-center bg-dark"
        defaultActiveKey="/"
        as="ul"
      >
        <Nav.Item as="li">
          <Nav.Link href="/">Home</Nav.Link>
        </Nav.Item>
        <Nav.Item as="li">
          <Nav.Link eventKey="link-1">Space Crafts</Nav.Link>
        </Nav.Item>
        <Nav.Item as="li">
          <Nav.Link eventKey="link-2">Planets</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
};

export default Home;
